import Link from "next/link";
import utils from "../styles/utils.module.css";

const Menu = () => (
  <nav>
    <div>hj</div>
    <style jsx>{`
      nav {
        position: fixed;
        top:0;
        left:0;
        background: #000;
        width: 100%;
        height: 100vh;
      }
    `}</style>
  </nav>
);

export default Menu;
